import {Link } from 'react-router-dom';

export default function Header() {
    return (
        <div>
            <Link to="/" className="header-button">
            <button onClick={() => navigateTo(PAGE_PRODUCT)} className="header-button">View Products</button>
          </Link>
          <Link to="/cart" className="header-button" >
            <button onClick={() => navigateTo(PAGE_CART)} className="header-button" >Go to Cart({cart.length})</button>
          </Link>

        </div>
    )
}
